script: |
  super -f text -I q921.spq | sort > q921.out

inputs:
  - name: q921.spq
    data: |
      SELECT ALL - col2 + col0 * - 35 AS col0 FROM tab1 (FORMAT parquet) WHERE - + col1 * + col2 - col0 * + col1 NOT IN ( + 25 / - col2 - 13 );
  - name: tab1

outputs:
  - name: q921.out
    data: |
      -1881
      -3034
      -3253
